packages <- c("ggplot2", "plotly", "dplyr", "bslib", "shiny", "shinythemes","shinylive","httr" )

# Function to install and load packages
install_and_load <- function(package) {
  if (!requireNamespace(package, quietly = TRUE)) {
    install.packages(package, character.only = TRUE, repos ="http://cran.rstudio.com/" ) #"https://cloud.r-project.org"
  }
  suppressMessages(library(package, character.only = TRUE))
}


# Install and load CRAN packages
invisible(lapply(packages, install_and_load))

getSimulationResult <- function(neh = 20, bwe = 0.046,maxtime=30) {
  
  # Initialize sequences for x and y
  time <- seq(1, maxtime, 1)
  k <- seq(0.01, 1, 0.01)
  
  # Initialize an empty dataframe to store the results with the correct column names
  result_df <- data.frame(time = integer(0),
                          k = numeric(0),
                          new_k = numeric(0),
                          rd = numeric(0))
  
  # Iterate over each value of x and y, computing their product and storing it in the dataframe
  for (t_i in time) {
    for (k_j in k) {
      temp_res <- get_all_error_sim(neh, k_j, t_i, bwe)
       
      result_df <- rbind(result_df, data.frame(
        time = t_i,
        k = k_j,
        new_k = temp_res[1],
        rd=temp_res[2]
      ))
    }
  }
  
  # View the result
  return(result_df)
  
}
# Constants
# bwe <- 0.046
ph <- 1.5574E-4

# Function to calculate the error
get_all_error_sim <- function(neh, k, t, bwe) {
  # Calculate new kt
  new_kt <- get_kt_h(neh, k, t, bwe)
  
  # Add estimated error
  new_kt <- new_kt + estimatedError_sim(neh, k, t, bwe)
  
  # Calculate new k and its error
  new_k <- new_kt / t
  new_k_error <- (k - new_k) / k
  
  return(c(new_k, new_k_error))
}

# Function to calculate the estimated error
estimatedError_sim <- function(neh, k, t, bwe) {
  base <- get_kt_h(neh, k, t, bwe)
  
  res <- 0
  
  for (i in 2:6) {
    res <- res + (base^i) / i
  }
  
  return(res)
}

# Function to calculate the kt value
get_kt_h <- function(neh, k, t, bwe) {
  h <- (1 - bwe / (1 - ph))^neh
  val <- (1 - h - (1 - h) * exp(-k * t)) / (1 - h)
  
  return(val)
}
